// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract BloodDonorRegistry {
    address public owner;
    uint256 private lastDonorId = 0; // Start ID at a known value to avoid collisions

    struct Donor {
        string name;
        string bloodType;
        bool exists;
    }

    mapping(uint256 => Donor) private donors;

    event DonorRegistered(uint256 indexed donorId, string name, string bloodType);

    modifier onlyOwner() {
        require(msg.sender == owner, "Not authorized");
        _;
    }

    constructor() {
        owner = msg.sender;
    }

    function generateUniqueId() private returns (uint256) {
        lastDonorId++; // Increment for uniqueness
        return lastDonorId;
    }

    function registerDonor(string memory _name, string memory _bloodType) 
        public 
        onlyOwner 
        returns (uint256) 
    {
        require(bytes(_name).length <= 32, "Name too long");
        require(bytes(_bloodType).length <= 8, "Blood type too long");

        uint256 id = generateUniqueId(); // Ensure unique IDs
        donors[id] = Donor(_name, _bloodType, true);

        emit DonorRegistered(id, _name, _bloodType);
        return id;
    }

    function getDonor(uint256 _id) 
        public 
        view 
        returns (string memory name, string memory bloodType) 
    {
        require(donors[_id].exists, "Donor not found");
        Donor memory donor = donors[_id];
        return (donor.name, donor.bloodType);
    }
}
